INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2015/12/17 15:00:00", 0.0, 1, 1, "キャル", 0, "2030/12/17 14:59:59", 0.0, -363.0, 7, 106001, 0, 7001, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる");
