INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2015/12/17 15:00:00", 0.0, 1, 1, "コッコロ", 0, "2030/12/17 14:59:59", 0.0, -363.0, 10, 105901, 0, 10003, 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2015/12/17 15:00:00", 0.0, 1, 1, "シェフィ", 0, "2030/12/17 14:59:59", 0.0, -363.0, 10, 106401, 2104010, 10004, 2, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね");
