INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2015/12/17 15:00:00", 0.0, 1, 1, "キャル", 0, "2030/12/17 14:59:59", 0.0, -363.0, 13, 106001, 0, 13001, 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2015/12/17 15:00:00", 0.0, 1, 1, "コッコロ", 0, "2030/12/17 14:59:59", 0.0, -363.0, 13, 105901, 0, 13002, 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2015/12/17 15:00:00", 0.0, 1, 1, "シェフィ", 0, "2030/12/17 14:59:59", 0.0, -363.0, 13, 106401, 2104010, 13003, 2, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ");
