INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2015/12/17 15:00:00", 0.0, 1, 1, "ペコリーヌ", 0, "2030/12/17 14:59:59", 0.0, -363.0, 14, 105801, 0, 14003, 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2015/12/17 15:00:00", 0.0, 1, 1, "キャル", 0, "2030/12/17 14:59:59", 0.0, -363.0, 14, 106001, 0, 14004, 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2015/12/17 15:00:00", 0.0, 1, 1, "コッコロ", 0, "2030/12/17 14:59:59", 0.0, -470.0, 15, 105901, 0, 15001, 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2015/12/17 15:00:00", 0.0, 1, 1, "シェフィ", 0, "2030/12/17 14:59:59", 0.0, -363.0, 16, 106401, 2104010, 16001, 2, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの");
