INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2019/01/31 12:00:00", 8.0, 2, 3, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 10.11, -385.0, 24, 109001, 0, 24003, 1, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2019/01/31 12:00:00", 8.0, 2, 4, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 4.0, -385.0, 24, 109001, 0, 24004, 1, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2019/01/31 12:00:00", 8.0, 2, 5, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 6.0, -385.0, 24, 109001, 0, 24005, 1, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2019/01/31 12:00:00", 0.0, 1, 6, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 0.0, 0.0, 24, 109002, 0, 24006, 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2019/01/31 12:00:00", 0.0, 1, 7, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 0.0, 0.0, 24, 109002, 0, 24007, 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2019/01/31 12:00:00", 0.0, 1, 8, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 0.0, 0.0, 24, 109002, 0, 24008, 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2019/01/31 12:00:00", 0.0, 1, 9, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 0.0, 0.0, 24, 109002, 0, 24009, 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2019/01/31 12:00:00", 0.0, 1, 10, "エリコ（バレンタイン）", 10011, "2030/12/17 14:59:59", 0.0, 0.0, 24, 109002, 0, 24010, 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2019/01/31 12:00:00", 8.0, 2, 1, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 2.12, -385.0, 24, 109101, 0, 24011, 1, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2019/01/31 12:00:00", 8.0, 2, 2, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 4.19, -385.0, 24, 109101, 0, 24012, 5, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2019/01/31 12:00:00", 8.0, 4, 3, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 2.3, -385.0, 24, 109101, 0, 24013, 2, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2019/01/31 12:00:00", 0.0, 1, 4, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 0.0, 0.0, 24, 109102, 0, 24014, 1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！");
