INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2019/01/31 12:00:00", 0.0, 1, 6, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 0.0, 0.0, 24, 109102, 0, 24016, 1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪");
