INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2019/01/31 12:00:00", 0.0, 1, 9, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 0.0, 0.0, 24, 109102, 0, 24019, 1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！");
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2019/01/31 12:00:00", 0.0, 1, 10, "シズル（バレンタイン）", 10011, "2030/12/17 14:59:59", 0.0, 0.0, 24, 109102, 0, 24020, 1, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪");
